import React from 'react';
import classes from './fitbit.module.css'
function Fitbit() {

return (
<div className={classes.main}>

		<div className={classes.Topbar} >
			<img src="png/fit_band_pink.png"  className={classes.fitbit-image-logo.logo}  />

			<span className={logo_text}>GearOS</span>
			
			<button type="button" className={classes.login-btn}>Login</button>
			
		</div>
		
		<div className={classes.mainContent} >
			<div className={classes.imageSection} >
				
			</div>
			<div className={classes.Feature} >
			</div>
		</div>
	
</div>
);
}
export default Fitbit;
